import java.util.*; public class Main{ public static void main(String[]args){ Scanner sc=new Scanner(System.in); int n=sc.nextInt(); int[] a=new int[n]; for(int i=0;i<n;i++)a[i]=sc.nextInt(); int[] freq=new int[10001]; for(int v:a)freq[v]++; int best=-1,cnt=-1; for(int i=0;i<freq.length;i++) if(freq[i]>cnt){ cnt=freq[i]; best=i; } System.out.print(best); } }